// import logo from './logo.svg';
import 'bootstrap/dist/css/bootstrap.min.css';
// get our fontawesome imports

import ReactDOM from 'react-dom'
// import { faHome } from "@fortawesome/free-solid-svg-icons";
// import { shoppingcart } from "@fortawesome/free-solid-svg-icons";
import { faFish } from "@fortawesome/free-solid-svg-icons";

import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";


// import './App.css';
// import './App.min.css';
// import Home from './component/home/Home';

function App() {
  return (
    <div className="App">


      <header className="App-header">
        <div class="navbar navbar-dark bg-dark shadow-sm">
          <div class="container">
            <a href="#" class="navbar-brand d-flex align-items-center">
              {/* <svg xmlns="http://www.w3.org/2000/svg" width="20" height="20" fill="none" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" aria-hidden="true" class="me-2" viewBox="0 0 24 24"><path d="M23 19a2 2 0 0 1-2 2H3a2 2 0 0 1-2-2V8a2 2 0 0 1 2-2h4l2-3h6l2 3h4a2 2 0 0 1 2 2z"></path><circle cx="12" cy="13" r="4"></circle></svg> */}
              <strong>Toko Online</strong>
            </a>
            <button class="navbar-toggler collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#navbarHeader" aria-controls="navbarHeader" aria-expanded="false" aria-label="Toggle navigation">
              {/* <span class="navbar-toggler-icon"></span> */}
              <FontAwesomeIcon icon={ faFish } />


            </button>

          </div>
        </div>
      </header>






      <div class="album py-5 bg-light">
        <div class="container">

          <div class="row row-cols-1 row-cols-sm-2 row-cols-md-3 g-3">


            <div class="col">
              <div class="card shadow-sm">

                <img src="http://localhost/assets/img/product/product-iphone.png" alt="" />
                <div class="card-body">
                  <p class="card-text">iPhone 6s Plus</p>
                  <p class="card-text">16GB</p>
                  <p class="card-text">3D Touch. 12MP photos. 4K video.</p>
                  <p class="card-text">$649.00</p>
                  <div class="d-flex justify-content-between align-items-center">
                    <div class="btn-group">
                      <button type="button" class="btn btn-sm btn-outline-secondary">Detail</button>
                    </div>
                    <small class="text-muted">9 mins</small>

                  </div>
                </div>
              </div>
            </div>








          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
